import "./App.css"
import { BrowserRouter, Route } from "react-router-dom"
import Home from "./pages/Home"

function App() {
	return (
		<BrowserRouter>
			<Route path="/" exact component={Home} />
			<Route path="/todos" exact component={Todos} />
			<Route path="/users" exact component={Users} />
		</BrowserRouter>
	)
}

export default App
